// See Buffer A

#define smoothstep(a,b,c) mix(a,b,((sin(clamp(c,0.,1.)*2.-1.)+1.)/2.))

vec4 lins(sampler2D h,vec2 c){
    return texelFetch(h,ivec2(c),0);
}
vec4 linr(sampler2D h,vec2 c){
    c-=.5;
    vec4 _0 = smoothstep(texelFetch(iChannel0,ivec2(c),0),texelFetch(iChannel0,ivec2(c)+ivec2(1,0),0),fract(c.x));
    vec4 _1 = smoothstep(texelFetch(iChannel0,ivec2(c)+ivec2(0,1),0),texelFetch(iChannel0,ivec2(c)+ivec2(1,1),0),fract(c.x));

    return smoothstep(_0,_1,fract(c.y));
}
vec4 old(vec2 u){
    vec4 real = linr(iChannel0,u);
    vec2 ns[] = 
    vec2[](vec2(-1,-1),vec2(-1,0),vec2(-1,1),vec2(0,-1),vec2(0,0),vec2(0,1),vec2(1,-1),vec2(1,0),vec2(1,1));

    float mn = 1.;
    vec4 color;

    for(int i = 0; i < ns.length();i++){
        float r = dot(abs(real-linr(iChannel0,floor(u+ns[i])+.5)),vec4(1))/3.;
        if(r<mn)color = linr(iChannel0,floor(u+ns[i])+.5);
        mn = min(mn,r);
    }

    return color;
}
vec4 neural(vec2 u){
    float s = iResolution.y/size.y;
    vec2 c = u/s;
    vec4 _n = texelFetch(iChannel0,ivec2(c),0);
    vec4 _c = linr(iChannel0,c);
    vec4 _u = (lins(iChannel0,c+vec2(0,1))+lins(iChannel0,c+vec2(1,1)))/2.;
    vec4 _d = (lins(iChannel0,c+vec2(0,-1))+lins(iChannel0,c+vec2(1,-1)))/2.;
    vec4 _l = (lins(iChannel0,c+vec2(-1,0))+lins(iChannel0,c+vec2(-1,1)))/2.;
    vec4 _r = (lins(iChannel0,c+vec2(1,0))+lins(iChannel0,c+vec2(-1,-1)))/2.;

    vec4 _o = (_u+_d+_l+_r)/4.;
    vec4 dif = abs(_n-_o);

    float mn = .1;
    return mix(_c,old(c),clamp(( dif-mn)*100.+mn,0.,1.));
}
void mn(out vec4 o,vec2 u){
    vec2 uv = u/iResolution.xy;

    o = neural(u);
}
void mainImage(out vec4 fragColor, in vec2 fragCoord){
    fragColor = vec4(0.);
    vec4 Fr = vec4(0.);
	int a = 3;
    for(int i1 = 0;i1<a;i1++){
    	for(int i2 = 0;i2<a;i2++){
    		mn(Fr,fragCoord+(vec2(float(i1),float(i2))/(float(a))));
            fragColor += Fr;
    	}
    }
    fragColor /= float(a*a);
}

precision highp float;

