    o = texelFetch(iChannel0,ivec2(u),0);
    int frames = 20;
    if(u.x>size.x||u.y>size.y/*||iFrame>frames*/||mod(u.x+u.y+float(iFrame),float(frames))>1.)return;
    else{
        def
        vec2 r = u;
        int slide = int(mod(floor(r.x),size.x)+floor(size.y-r.y)*size.x);
        int p = no;
        ivec4 s = ivec4(data[slide/p*3],data[slide/p*3+1],data[slide/p*3+2],0);
        o = mod(vec4(s*int(prc)/int(pow(prc,float(slide%no)+1.))),prc)/prc;
    }
}
